import React from 'react';
import './Microsoft.css';
import IconButton from '../../components/IconButton.js'
import Tag from '../../components/Tag.js'

function Microsoft() {
    return (
        <div class="microsoft">
            <div class="heading">
                <p class="title">Microsoft</p>
                <p class="subtitle">Core Search & AI</p>
                <p class="subtitle">I'm on the Core Search & AI Metrics team, which is constantly implementing state-of-the-art ML models to manufacture and monitor the high-quality metrics that power Bing (the second most-used search engine in the world).</p>
            </div>
            <div class="content">
                <div class="tag-row">
                    <Tag text="Machine Learning"></Tag>
                    <Tag text="Natural Language Processing"></Tag>
                    <Tag text="Data Science"></Tag>
                </div>
                <p class="text"></p>
            </div>
        </div>
    );
}

export default Microsoft;
